import React, {Component} from "react";
import {gql} from '@apollo/client';
import { graphql } from '@apollo/client/react/hoc';
import Typography from '@material-ui/core/Typography';
import {Box} from "@material-ui/core";
import {Link as RouterLink} from "react-router-dom";

const fetchCapacityAndQueue = gql`
query capacityAndQueue {
    companies {
        id
        name
        actualChangeRequestCapacity
        actualAnalysisCapacity
        actualDevelopmentCapacity
        actualTestingCapacity
        
        timeLeft
        analysisTimeLeft
        developmentTimeLeft
        testingTimeLeft
        
        queueLength
        analysisQueueLength
        developmentQueueLength
        testingQueueLength
    }
    
    dedicatedTeams {
        id
        name
        actualChangeRequestCapacity
        actualAnalysisCapacity
        actualDevelopmentCapacity
        actualTestingCapacity
        
        timeLeft
        analysisTimeLeft
        developmentTimeLeft
        testingTimeLeft
        
        queueLength
        analysisQueueLength
        developmentQueueLength
        testingQueueLength
    }
    
    projectTeams {
        id
        name
        actualChangeRequestCapacity
        actualAnalysisCapacity
        actualDevelopmentCapacity
        actualTestingCapacity
        
        timeLeft
        analysisTimeLeft
        developmentTimeLeft
        testingTimeLeft
        
        queueLength
        analysisQueueLength
        developmentQueueLength
        testingQueueLength
    }
}
`;

class CapacityAndQueue extends Component {
    render() {
        if (this.props.data.loading) { return <div>Loading ...</div> }

        const capacityAndQueue = this.props.data.capacityAndQueue
        const companies = capacityAndQueue.companies
        const dedicatedTeams = capacityAndQueue.dedicatedTeams

        console.log(companies)

        return (
            <Box>
                <Typography variant="body1">
                    Очередь (месяцы)
                </Typography>
            </Box>
        );
    }
}

export default graphql(fetchCapacityAndQueue)(CapacityAndQueue);
